INSERT INTO `experience` (`IDexperience`, `IDpost`, `IDplace`, `StartDay`, `EndDay`, `Title`, `Description`) VALUES
(175, 99, 44, '2021-12-04', '2021-12-04', 'Partenza', 'Tutto inizia in aeroporto, dove il gruppo si incontra, e continua a cena. Capiamo fin da subito che nella ciurma abbiamo degli esperti: Enrico, l’addetto alle app che monitora costantemente la applicazione dell’aurora boreale, Salvo, il nostro selfista ufficiale e Giuseppe, l’appassionato fotografo che scatterà delle foto memorabili della vacanza.'),
(176, 99, 45, '2021-12-05', '2021-12-05', 'Primi avvistamenti', 'È solo la prima sera, siamo un po’ stanchi per il viaggio in aereo, ma sufficientemente carichi per scattar via a caccia di aurora non appena Enrico, il nostro “app man”, ci fa sapere che le probabilità di avvistarla sono alte. Guidiamo verso il faro su una strada scura che taglia le praterie della penisola di Reykjanes. Guidiamo con gli occhi fissi al cielo nero nella speranza di scorgere un abbaglio di luce. Dopo alcuni chilometri, nel vuoto de'),
(177, 99, 46, '2021-12-06', '2021-12-07', 'Laguna Blu', 'Il giorno seguente siamo già in cammino verso la Laguna Blu che ci accoglie con sbuffi di fumi che sembrano uscire direttamente dalle croste di lava nera che la circondano. I raggi dorati del sole mattutino fendono il vapore morbido che si leva dalle acque turchesi mentre noi chiacchieriamo felicemente a mollo sorseggiando una fresca birra. Ci spalmiamo in faccia maschere d’argilla, ci chiudiamo nella sauna e andiamo a nuotare.'),
(178, 100, 47, '2021-12-03', '2021-12-04', 'Partenza', 'La mattina alle 6 sono finalmente uscito per andare a prendere silvia in macchina e partire per la Puglia. Perciò una volta caricate le sue valigie ci siamo messi alla guida e come ogni cliché su un viaggio di coppia lei si è addormentata da subito e io ho provato a guidare il più piano possibile per evitare autovelox e multe. Durante il viaggio però non potevamo non fare una pausa per seguire l\'esame di elettrotecnica di Gabri... Un bellissimo 2'),
(179, 100, 48, '2021-12-04', '2021-12-04', 'Polignano', 'Prima tappa a Polignano a Mare e come non fare un bellissimo bagno nella caletta del paese? Acqua bellissima e possibilità di fare dei tuffi da qualunque altezza. Finito il bagno dritti a mangiare il miglior panino di pesce d\'Italia da Pescaria. Gelato, passeggiata per il centro e si riparte per Crispiano dov\'è casa di nonna'),
(180, 101, 49, '2021-11-05', '2021-11-05', 'Arrivo', 'Siamo arrivati la sera del 18 Giugno sotto un acquazzone memorabile! Stanchi ma adrenalinici ammiriamo le luci di Manhattan tra i rivoli di pioggia sul finestrino dello Shuttle che ci porta dal JFK in centro, increduli di essere per la prima volta sul suolo Americano; arrivati al nostro “Dream Hotel Midtown” e svolte le operazioni di rito, chiudiamo questa giornata.'),
(181, 101, 50, '2021-11-06', '2021-11-06', 'Giro sull\' hop on hop off', 'Ci è sembrato un buon metodo per prendere confidenza con la città e avere una prima idea di quello che poi avremmo visto in maniera più dettagliata. Con questo tour sul BIG-BUS si toccano da vicino vari punti di interesse e le emozioni sono state subito tante – alcune anche inaspettate; ho avuto un momento di smarrimento pensando che ancora non riuscivo a riconoscere la mia New York, quella di tanti film, di tanti libri e di tanti sogni.'),
(184, 102, 51, '2021-12-03', '2021-12-03', 'Palazzo Vecchio', 'Il fulcro della vita politica e civile della Firenze rinascimentale, è ancora oggi uno degli emblemi della città. Oltre a essere sede del Comune cittadino, il maestoso palazzo in piazza della Signoria a Firenze è adibito anche a museo, le cui magnifiche sale racchiudono opere di grande importanza storica e artistica. È stato anche il palazzo privato dei Medici e racchiude infatti affreschi, statue e stanze segrete volute da più importanti membri '),
(185, 102, 51, '2021-12-03', '2021-12-03', 'Basilica di Santa Croce', 'La basilica di Santa Croce conserva ancora al suo interno splendidi affreschi medievali di artisti come Giotto e Taddeo Gaddi, e ospita le tombe di importanti uomini fiorentini che hanno segnato la storia dell\'Italia intera, come Michelangelo e Galileo Galilei.');

